import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { HeartIcon } from '@heroicons/react/24/outline';
import { HeartIcon as HeartIconSolid } from '@heroicons/react/24/solid';

const RecruiterDashboard = () => {
  const [candidates, setCandidates] = useState([
    {
      id: 1,
      name: 'John Doe',
      role: 'Full Stack Developer',
      projects: [
        {
          title: 'AI-Powered Task Manager',
          description: 'A smart task management system with AI suggestions',
          githubLink: 'https://github.com/example/task-manager',
          hackathon: 'AI Innovation Challenge 2024',
          rating: 9,
        },
      ],
      skills: ['React', 'Node.js', 'Python', 'Machine Learning'],
      interested: true,
    },
    {
      id: 2,
      name: 'Jane Smith',
      role: 'Blockchain Developer',
      projects: [
        {
          title: 'Blockchain Voting System',
          description: 'Secure and transparent voting system using blockchain',
          githubLink: 'https://github.com/example/voting-system',
          hackathon: 'Web3 Development Hackathon',
          rating: 8,
        },
      ],
      skills: ['Solidity', 'Web3.js', 'React', 'Node.js'],
      interested: false,
    },
  ]);

  const toggleInterest = (candidateId) => {
    setCandidates(
      candidates.map((c) =>
        c.id === candidateId ? { ...c, interested: !c.interested } : c
      )
    );
  };

  return (
    <div className="space-y-8">
      <h1 className="text-2xl font-bold text-gray-800 dark:text-white">Recruiter Dashboard</h1>

      <div className="grid grid-cols-1 gap-6">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          className="bg-white dark:bg-gray-800 rounded-xl shadow-lg p-6"
        >
          <h2 className="text-xl font-semibold mb-4 text-gray-800 dark:text-white">Candidate Profiles</h2>
          <div className="space-y-6">
            {candidates.map((candidate) => (
              <motion.div
                key={candidate.id}
                whileHover={{ scale: 1.02 }}
                className="p-6 bg-gray-50 dark:bg-gray-700 rounded-lg"
              >
                <div className="flex justify-between items-start">
                  <div>
                    <h3 className="text-lg font-medium text-gray-800 dark:text-white">{candidate.name}</h3>
                    <p className="text-sm text-gray-600 dark:text-gray-300">{candidate.role}</p>
                  </div>
                  <motion.button
                    whileHover={{ scale: 1.1 }}
                    whileTap={{ scale: 0.9 }}
                    onClick={() => toggleInterest(candidate.id)}
                    className={`p-2 rounded-full ${
                      candidate.interested
                        ? 'text-red-500'
                        : 'text-gray-400 hover:text-red-500'
                    }`}
                  >
                    {candidate.interested ? (
                      <HeartIconSolid className="h-6 w-6" />
                    ) : (
                      <HeartIcon className="h-6 w-6" />
                    )}
                  </motion.button>
                </div>

                <div className="mt-4">
                  <h4 className="text-sm font-medium text-gray-700 dark:text-gray-300 mb-2">Skills</h4>
                  <div className="flex flex-wrap gap-2">
                    {candidate.skills.map((skill) => (
                      <span
                        key={skill}
                        className="px-3 py-1 bg-primary-100 dark:bg-primary-900 text-primary-800 dark:text-primary-200 rounded-full text-sm"
                      >
                        {skill}
                      </span>
                    ))}
                  </div>
                </div>

                <div className="mt-4">
                  <h4 className="text-sm font-medium text-gray-700 dark:text-gray-300 mb-2">Projects</h4>
                  <div className="space-y-3">
                    {candidate.projects.map((project, index) => (
                      <div
                        key={index}
                        className="p-3 bg-white dark:bg-gray-800 rounded-lg border border-gray-200 dark:border-gray-600"
                      >
                        <div className="flex justify-between items-start">
                          <div>
                            <h5 className="font-medium text-gray-800 dark:text-white">{project.title}</h5>
                            <p className="text-sm text-gray-600 dark:text-gray-300 mt-1">
                              {project.description}
                            </p>
                            <p className="text-sm text-gray-500 dark:text-gray-400 mt-1">
                              Hackathon: {project.hackathon}
                            </p>
                          </div>
                          <div className="flex items-center space-x-2">
                            <span className="text-sm font-medium text-gray-700 dark:text-gray-300">
                              Rating: {project.rating}/10
                            </span>
                            <a
                              href={project.githubLink}
                              target="_blank"
                              rel="noopener noreferrer"
                              className="text-sm text-primary-600 hover:text-primary-700"
                            >
                              View on GitHub
                            </a>
                          </div>
                        </div>
                      </div>
                    ))}
                  </div>
                </div>
              </motion.div>
            ))}
          </div>
        </motion.div>
      </div>
    </div>
  );
};

export default RecruiterDashboard;
